import React from 'react'
import Expenses from "../src/components/Expenses/Expenses";
import NewExpense from './components/NewExpense/NewExpense';

// const App = () => Arrow function 
// function App()
const App = () => {
  const expenses = [
    { title: "Car Insurance", amount: 999, date: new Date(2021, 4, 3) },
    { title: "Bills", amount: 45, date: new Date(2021, 5, 23) },
    { title: "grocery", amount: 65, date: new Date(2021, 5, 5) },
    { title: "fees", amount: 85, date: new Date(2021, 5, 23) },
  ];
  // we can use this code also alternative to the below JSX code but a good practise is to make your entire web in a JSX(simple HTML text in a React Application).
  // return React.createElement('div' ,
  //  {} ,
  //  React.createElement('h1' , {} , 'Expense Tracker') ,
  //  React.createElement(Expenses , {items : expenses}));
  return (
    <div>
      <NewExpense />
      <Expenses items={expenses} />
    </div>
  );
}
export default App;
